void hsp_tft18_init(void)
{



    hsp_tft18_write_cmd(0x11);		// Sleep out & booster on
   HAL_Delay(19);

    hsp_tft18_write_cmd(0xB1);		// Frame Rate Control for normal mode
    hsp_tft18_write_byte(0x05);
	hsp_tft18_write_byte(0x3C);
	hsp_tft18_write_byte(0x3C);

    hsp_tft18_write_cmd(0xB2);		// Frame Rate Control for idle mode
    hsp_tft18_write_byte(0x05);
	hsp_tft18_write_byte(0x3C);
	hsp_tft18_write_byte(0x3C);

    hsp_tft18_write_cmd(0xB3);		// Frame Rate Control for  partial mode + full colors
    hsp_tft18_write_byte(0x05);
	hsp_tft18_write_byte(0x3C);
	hsp_tft18_write_byte(0x3C);
    hsp_tft18_write_byte(0x05);
	hsp_tft18_write_byte(0x3C);
	hsp_tft18_write_byte(0x3C);

    hsp_tft18_write_cmd(0xB4);		// Display Inversion Control
	hsp_tft18_write_byte(0x03);		// Frame inversion

	hsp_tft18_write_cmd(0x3A);		// Interface pixel format
    hsp_tft18_write_byte(0x05);		// Interface format: 16-bit pixel; use "0x55" when writing 16-bit data

    hsp_tft18_write_cmd(0x20);		// Display inversion off
    hsp_tft18_write_cmd(0x13);		// Partial mode off

    hsp_tft18_write_cmd(0x26);		// Gamma curve select
    hsp_tft18_write_byte(0x01);		// 1,2,4,8

    hsp_tft18_write_cmd(0x29);		// Display on

    hsp_tft18_write_cmd(0x36);		// Memory Data Access Control: MX, MY, RGB mode
    //hsp_tft18_write_byte(0xC0);	// 180
    //hsp_tft18_write_byte(0x00);	// Normal: top to bottom, left to right, RGB
    //hsp_tft18_write_byte(0xC8);
    //hsp_tft18_write_byte(0xA0);	// up-side-down (CW)
    //hsp_tft18_write_byte(0x60);	// up-side-down (CCW)
    hsp_tft18_write_byte(0x70);		// HSP-GD4

	//hsp_tft18_set_region(0, 0, TFT_X_MAX-1, TFT_Y_MAX-1);
    //hsp_tft18_clear(INDIGO);
	hsp_tft18_clear(BLACK);

}

static uint8_t hsp_spi_write_byte(uint8_t byte)
{
	HAL_SPI_Transmit(&hspi1, byte, 1, 10);
}

void hsp_tft18_write_cmd(uint8_t dat)
{
	LCD_DC_LOW();
    hsp_spi_write_byte(dat);
}

void hsp_tft18_write_byte(uint8_t dat)
{
	LCD_DC_HIGH();
    hsp_spi_write_byte(dat);
}

void hsp_tft18_write_2byte(uint16_t dat)
{
	LCD_DC_HIGH();
    hsp_spi_write_byte(dat>>8);
    hsp_spi_write_byte(dat);
}

