{
    uint16_t i, m;

    hsp_tft18_set_region(0, 0, TFT_X_MAX-1, TFT_Y_MAX-1);

    for(i=0; i<TFT_X_MAX; i++)
        for(m=0; m<TFT_Y_MAX; m++)
        {
            hsp_tft18_write_2byte(Color);
        }
}

