void hsp_tft18_test_color(void)
{
	uint8_t i=1;
	hsp_tft18_clear(GRAY0);

	delay_1ms(200);

	while(i--)
	{
		hsp_tft18_clear(WHITE);
        delay_1ms(200);
		hsp_tft18_clear(BLACK);
        delay_1ms(200);
		hsp_tft18_clear(RED);
        delay_1ms(200);
	  	hsp_tft18_clear(GREEN);
        delay_1ms(200);
	  	hsp_tft18_clear(BLUE);
        delay_1ms(200);
	}
}

// x: count by dot (0~159), y: count by line (16 dots per line)
void hsp_tft18_show_char(uint16_t x, uint16_t y, uint8_t data)
{
    uint8_t i,j;
    uint8_t temp;

    for(i=0; i<16; i++)
    {
        hsp_tft18_set_region(x, y+i, x+7, y+i);
        temp = tft_ascii[data-32][i];
        for(j=0; j<8; j++)
        {
            if(temp & 0x01)
                hsp_tft18_write_2byte(WHITE);
            else
                hsp_tft18_write_2byte(BLACK);
				temp>>=1;
        }
    }
}

