// x: count by dot (0~159), y: count by line (16 dots per line)
void hsp_tft18_show_int8(uint16_t x, uint16_t y, int8_t data)
{
    uint8_t a[3];
    uint8_t i;
    if(data < 0)
    {
        hsp_tft18_show_char(x, y*16, '-');
        data = -data;
    }
    else
        hsp_tft18_show_char(x, y*16, ' ');

    a[0] = data/100;
    a[1] = data/10%10;
    a[2] = data%10;
    i = 0;
    while(i<3)
    {
        hsp_tft18_show_char(x+(8*(i+1)), y*16, '0'+a[i]);
        i++;
    }
}

