void hsp_tft18_draw_line_h(uint16_t x_start, uint16_t y_start, uint16_t length, uint16_t color)
{
    uint8_t i = 0;

    if(((x_start+length)>TFT_X_MAX) || (x_start>(TFT_X_MAX-1)) || (y_start>(TFT_Y_MAX-1)))
        return;

    for(i=0; i<length; i++)
        hsp_tft18_draw_pixel(x_start+i, y_start, color);
}

void hsp_tft18_draw_line_v(uint16_t x_start, uint16_t y_start, uint16_t length, uint16_t color)
{
    uint8_t i = 0;

    if(((y_start+length)>TFT_Y_MAX) || (x_start>(TFT_X_MAX-1)) || (y_start>(TFT_Y_MAX-1)))
        return;

    for(i=0; i<length; i++)
        hsp_tft18_draw_pixel(x_start, y_start+i, color);
}

void hsp_tft18_draw_frame(uint8_t x_start, uint8_t y_start, uint8_t dx, uint8_t dy, uint16_t color)
{
    if(((x_start+dx)>TFT_X_MAX) || ((y_start+dy)>TFT_Y_MAX) || \
        (x_start>(TFT_X_MAX-1)) || (y_start>(TFT_Y_MAX-1)))
		return;

    hsp_tft18_draw_line_h(x_start, y_start, dx, color);
	hsp_tft18_draw_line_h(x_start, y_start+dy, dx, color);
    hsp_tft18_draw_line_v(x_start, y_start, dy, color);
	hsp_tft18_draw_line_v(x_start+dx, y_start, dy, color);
}

void hsp_tft18_draw_block(uint8_t x_start, uint8_t y_start, uint8_t dx, uint8_t dy, uint16_t color)
{
    uint8_t i, j;

    if(((x_start+dx)>TFT_X_MAX) || ((y_start+dy)>TFT_Y_MAX) || \
        (x_start>(TFT_X_MAX-1)) || (y_start>(TFT_Y_MAX-1)))
		return;

    for(i=0; i<dy; i++)
    {
        for(j=0; j<dx; j++)
        {
            hsp_tft18_set_xy(x_start+j, y_start+i);
            hsp_tft18_write_2byte(color);
        }
    }
}

// x: count by dot (0~159), line: line number (16 dots per line)
void hsp_tft18_draw_menu_cursor(uint16_t x, uint8_t line, uint16_t color)
{
	uint8_t i, j, data;

    for(i=0; i<16; i++)
    {
		hsp_tft18_set_region(x, line*16+i, x+16, line*16+i);
        data = menu_cursor1[i*2];
        for(j=0; j<8; j++)
        {
            if(data & 0x01)
                hsp_tft18_write_2byte(color);
            else
                hsp_tft18_write_2byte(BLACK);
            data >>= 1;
        }
        data = menu_cursor1[i*2+1];
        for(j=0; j<8; j++)
        {
            if(data & 0x01)
                hsp_tft18_write_2byte(color);
            else
                hsp_tft18_write_2byte(BLACK);
            data >>= 1;
        }
    }
}

void hsp_tft18_draw_image(const uint8_t *p)
{
    uint16_t i;
    uint8_t picH, picL;

    hsp_tft18_clear(WHITE);

	hsp_tft18_set_region(0, 0, TFT_X_MAX-1, TFT_Y_MAX-1);
	for(i=0; i<(TFT_X_MAX*TFT_Y_MAX); i++)
	{
		picL = *(p+i*2);
		picH = *(p+i*2+1);
		hsp_tft18_write_2byte(picH<<8 | picL);
	}
}

